import React from "react";
import Col from "react-bootstrap/Col";

const Cards = (props) => {
  const storyHeading = {
    textAlign: "center",
    fontSize: "40px",
    letterSpacing: "2px",
    borderBottom: "1px solid #dedede",
    paddingBottom: "5px",
    color: "#932a33",
    fontWeight: "600",
  };
  return (
    <div className="wrap-around">
      <h1 style={storyHeading}>{props.storyHeading}</h1>
      <Col md={8}>
        <div className="content-wrapper">
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Laboriosam
            fuga ea iste omnis fugit nemo aliquid. Minima, tempore fugit quaerat
            deserunt vero asperiores quia dignissimos nostrum ea laudantium
            placeat sunt.
          </p>
        </div>
      </Col>
      <Col md={4}>
        <div className="card-img">
          <img src={props.imgSrc} alt="client" className="img-fluid" />
        </div>
      </Col>
    </div>
  );
};

export default Cards;
